// src/pages/EMSDashboard.jsx
import React from "react";
import TopBar from "../components/TopBar";
import { Link } from "react-router-dom";
import Footer from "../components/Footer";


function EMSDashboard() {
  return (
    <>
      <TopBar />
      <div className="p-6 min-h-screen bg-gray-900 text-white">
        <h2 className="text-3xl font-bold mb-6 text-asuGold text-center">
          Welcome to the EMS Dashboard
        </h2>

        <div className="grid gap-6 max-w-4xl mx-auto">
          {/* Card linking to Events Page */}
          <Link to="/events" className="block bg-gray-800 hover:bg-gray-700 transition p-6 rounded-2xl shadow-lg">
            <h3 className="text-xl font-semibold text-asuGold">üìÖ Go to Events Page</h3>
            <p className="mt-2 text-sm text-gray-300">
              View or manage event reservations, item status, and location-based logs.
            </p>
          </Link>

          {/* Today's Mall Table Activity */}
          <div className="bg-gray-800 p-6 rounded-2xl shadow-md">
            <h3 className="text-xl font-semibold text-white mb-2">ü™ë Today‚Äôs Mall Table Check-Ins / Check-Outs</h3>
            <p className="text-gray-400 text-sm">
              View today's activity for all mall tables and chairs. Org name, time, and items will be listed.
            </p>
            {/* TODO: Add dynamic table here */}
          </div>

          {/* Full Lookup (Separate Page) */}
          <Link to="/ems-lookup" className="block bg-gray-800 hover:bg-gray-700 transition p-6 rounded-2xl shadow-lg">
            <h3 className="text-xl font-semibold text-white">üîç Full Mall Table Lookup</h3>
            <p className="mt-2 text-sm text-gray-300">
              Search through all historical checkouts of mall tables and chairs by date, org name, or barcode.
            </p>
          </Link>
        </div>
      </div>
      <Footer />
    </>
  );
}

export default EMSDashboard;
